import React from 'react';
import { Tabs, Tab } from '@material-ui/core';
import { InputAdornment, TextField, IconButton } from "@material-ui/core";
import SearchIcon from '@material-ui/icons/Search';
import ArrowDropDownIcon from '@material-ui/icons/ArrowDropDown';
import RoomIcon from '@material-ui/icons/Room';
// import { InputAdornment, TextField, IconButton } from "@material-ui/core";
// import SearchIcon from '@material-ui/icons/Search';
// import {MapIcon} from '@material-ui/icons';
// import { BiMap } from 'react-icons';

export default function NavBar() {

  const NavStyle1 = {
    color: "white",
    opacity: 1,
    fontWeight: "bolder",
    marginLeft: 'auto'
  }

  const NavStyle2 = {
    color: "white",
    opacity: 1,
    fontWeight: "bolder",
  }

  const locStyle = {
    justifyContent: "center",
    color: "white",
    opacity: 1,
    fontWeight: "bolder",
    background: "black",
    margin: "5px",
    padding: "none"
  }

  const searchLocationStyle = { backgroundColor: "white", width: "20%", borderRadius: "10px", marginBottom: "30px" };

  return (
    <div>
      <Tabs>
        <Tab label="Location" style={locStyle} value="1">

        </Tab>
        <Tab label="Login" style={NavStyle1} value="1" />
        <Tab label="Sign-up" style={NavStyle2} value="2" />
      </Tabs>
    </div>

  )
}
